import React from 'react'
import './style.css'
const test = ()=>{
   return (
    <div>
        <h1>This is text box</h1>
        <input type="text" placeholder="Enter Your Name Here!" />
        <h2>This is Disabled Text Box</h2>
        <input type="text" className="formControl" placeholder="" disabled="disabled" />

    </div>

   )
}
export default test;
